description:
Wiimms Mario Kart Fun is a series of Custom Track Distributions. Wiimm made his first private distribution in February 2010. After 2 more private distributions the first public was released in December 2010.
This page will give an overview about Wiimms Mario Kart custom track distributions.

The main goal of Wiimms distribution was and is, to play custom tracks online. To realize it, all player must play the identical distribution. Wiimms way was to develop tools that can load a copy of a original Mario Kart DVD, patch it, and create a new Custom track image.

The main series is called Wiimms Mario Kart Fun. Because of the main goal to playing online some tracks are exchanged from one release to the next. The most important tracks stay in many releases.

More info: http://wiki.tockdom.com/wiki/Wiimms_Mario_Kart_Fun

